import React from "react";
import s from "./Login.module.css";

const Login = () => {

    const handleChange = () => {

    }

    const loginUser = (e) => {
        e.preventDefault();
    }

    return(
        <form 
            className={s.loginBody}
            onSubmit={loginUser}
        >
            <h3>Login</h3>
            <p>Enter your email and password</p>
            <label 
                className={s.label} 
                htmlFor="email"
            >
                <input 
                    className={s.inputBase} 
                    onChange={handleChange} 
                    name="email" 
                    type="text" 
                />
            </label>
            <label 
                className={s.label} 
                htmlFor="password"
            >
                <input 
                    className={s.inputBase} 
                    onChange={handleChange} 
                    name="password" 
                    type="text" 
                />
            </label>
            <input 
                className={s.submitBtn} 
                type="submit" 
                value="Login" 
            />
            {/* Smack chat uses react router to navigate between login and register pages */}
            {/* <p>Create an account <a href="">here</a></p> */}
        </form>
    )
}

export default Login;
